syntax = "proto3";

package tinder.events.model.app.hubble.details;

option go_package = "github.com/TinderBackend/events.sdk/libraries/model/golang/model/app/hubble/details";
option java_multiple_files = true;
option java_package = "com.tinder.generated.events.model.app.hubble.details";

message PhotoSelectorModelDownloadDetails {
    ModelDownloadOutcome model_download_outcome = 1;
    enum ModelDownloadOutcome {
        MODEL_DOWNLOAD_OUTCOME_INVALID = 0;
        MODEL_DOWNLOAD_OUTCOME_SUCCESS = 1;
        MODEL_DOWNLOAD_OUTCOME_FAILURE = 2;
    }
    
    reserved 2;
    
    reserved "source";
}
